<?php

namespace Database\Seeders;

use App\Models\Product;
use Illuminate\Database\Seeder;
use Faker\Factory as Faker;

class ProductSeeder extends Seeder
{
    /**
     * Run the database seeds.
     */
    public function run(): void
    {
        $faker = Faker::create();

        $pictures = [
            "data:image/jpeg;base64,",
            "https://allcell.am/wp-content/uploads/2024/05/Screenshot_7-6.jpg",
            "https://3dplanet.am/wp-content/uploads/2021/09/13-Midnight.jpg",
            "https://yerevanmobile.am/media/catalog/product/cache/07720dad39bc68bc6b838050c0f2e34d/1/4/14_pro_1.jpg",
            "https://i5.walmartimages.com/seo/Pre-Owned-Apple-iPhone-X-256GB-Factory-Unlocked-Smartphone-Refurbished-Good_9b5ec8b2-9665-463b-adc5-64829ba72da6.1b496e5a8fcee76fdad69bae12b54745.jpeg",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "https://allcell.am/wp-content/uploads/2023/03/google-pixel-7.webp",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
        ];

        foreach (range(1, 10) as $index) {
            Product::create([
                'name' => $faker->unique()->word,
                'description' => $faker->sentence,
                'price' => $faker->randomFloat(2, 100, 1000), // Random price between 100 and 1000
                'category_id' => $faker->numberBetween(1, 2), // Assuming there are 2 categories (Smartphones and Tablets)
                'stock_quantity' => $faker->numberBetween(10, 100), // Random stock quantity between 10 and 100
                'image_url' => $pictures[$index - 1] ?? $faker->imageUrl(640, 480, 'technics', true, 'iphone'),
            ]);
        }
    }
}
